CREATE TABLE visualization_metadata (
    visualization_id SERIAL PRIMARY KEY,
    visualization_name VARCHAR(255),
    visualization_type VARCHAR(50),
    visualization_description TEXT
);

CREATE TABLE visualization_results (
    id INT PRIMARY KEY,
    query_name VARCHAR(50),
    dataset_results JSONB,
    query_execution_time TIMESTAMP
);

CREATE TABLE queries (
    query_id INT PRIMARY KEY,
    query_text TEXT,
    execution_time FLOAT,
    created_at TIMESTAMP
);

CREATE TABLE datasets (
    dataset_id INT PRIMARY KEY,
    dataset_name VARCHAR(50),
    dataset_description TEXT,
    created_by VARCHAR(50)
);

CREATE TABLE visualizations (
    viz_id INT PRIMARY KEY,
    viz_name VARCHAR(50),
    viz_type VARCHAR(50),
    viz_data JSONB
);

CREATE TABLE visualization_data (
    id SERIAL PRIMARY KEY,
    query_id INT,
    query_result JSONB,
    visualization_type VARCHAR(50)
);

CREATE TABLE query_results (
    id SERIAL PRIMARY KEY,
    query TEXT,
    result JSONB
);

CREATE TABLE statistical_analysis (
    id SERIAL PRIMARY KEY,
    analysis_id INT,
    analysis_result JSONB,
    visualization_id INT
);

CREATE TABLE visualization_types (
    id SERIAL PRIMARY KEY,
    type_name VARCHAR(50),
    description TEXT
);

CREATE TABLE analysis_types (
    id SERIAL PRIMARY KEY,
